const Svg = ({ color, size, viewBox, ...props }: Props) => (
  <svg
    fill={color}
    height={size}
    viewBox={viewBox}
    width={size}
    xmlns="http://www.w3.org/2000/svg"
    {...props}
  />
);

Svg.defaultProps = {
  color: 'currentColor',
  size: 24,
};

